Show subtasks(related to the task) in Angular js<p>Sorry if the title was confusing, I'm creating a web application which lets the user to add tasks and sub-tasks.I have managed to make angular to get the tasks from database(mongodb) and show the result in my dashboard.html file. But I'm having problems with the sub-tasks. I have a button on each task and when clicked should show all the sub-tasks which belong to that task. In the current situation the problem is that when I want to see the sub-tasks belonging to one task they appear as sub-tasks of all of my tasks.</p>

<p>My <code>dashboard.html</code> looks like this:</p>

<pre><code>&lt;body ng-app="dashboard"&gt;
    &lt;div class="container list-group list-group"  ng-controller="dashboardCtrl"&gt;
        &lt;ul ng-repeat="task in tasks" class="list-group-item list-group-item-action"&gt;
            &lt;li class="list_style"&gt;
                &lt;span&gt;{{task.name}}&lt;/span&gt;&lt;span&gt;{{task.description}}&lt;/span&gt;
                &lt;span&gt;&lt;button class="btn btn-danger" ng-click="remove(task._id)"&gt;Delete&lt;/button&gt;&lt;/span&gt;
                &lt;span&gt;&lt;button class="btn btn-info" ng-click="edit(task._id)"&gt;Edit&lt;/button&gt;&lt;/span&gt;
                &lt;span&gt;&lt;button class="btn btn-info" ng-click="addTask(task._id)"&gt;Add new task&lt;/button&gt;&lt;/span&gt;
                &lt;span&gt;&lt;button class="btn btn-success" ng-click="showTasks(task._id)"&gt;+&lt;/button&gt;&lt;/span&gt;
            &lt;/li&gt;
            &lt;ul ng-repeat="subTask in subTasks" class="list-group-item list-group-item-action active" 
                style="margin-top: 10px;"&gt;
                    &lt;li&gt;{{subTask.name}}&lt;/li&gt;
                    &lt;li&gt;{{subTask.description}}&lt;/li&gt;
                    &lt;li&gt;{{subTask.due_date}}&lt;/li&gt;
            &lt;/ul&gt;
        &lt;/ul&gt;    
    &lt;/div&gt;
&lt;/body&gt;
</code></pre>

<p>My controller looks like this:</p>

<pre><code>var app = angular.module('dashboard', []);
app.controller('dashboardCtrl', function($scope, $http, $window){

    ///////Used to get all the tasks from the database

     var refresh = function() {
        $http.get('api/tasks').then(function(response) {
          $scope.tasks = response.data;
          console.log("Data retrieved successfully");
          console.log(response);
        });
      };
      refresh();

      ///////Used to get the all the sub-tasks belonging to task with specified id

      $scope.showsubTasks = function(id){
        $http.get('api/task/'+ id).then(function(response) {
            console.log("Data retrieved successfully");
            console.log(response);
            $scope.subTasks = response.data.subTasks;
          });
      }  
})
</code></pre>

<p>And my task schema looks like this:</p>

<pre><code>const mongoose=require("mongoose");

const taskSchema=mongoose.Schema({
    name:{
        type: String,
        required: true
    },
    description:{
        type: String,
        required: true
    } ,
     subTasks:[{
        name:{
            type: String,
            required: true
        },
        description:{
            type: String,
            required: true
        },
        due_date:{
            type: String,
            required:true
        }
     }]
});
const list = module.exports = mongoose.model("list", listSchema);
</code></pre>

<p>The index.js file:</p>

<pre><code>///// to get the tasks
router.get("/tasks", (req,res)=&gt;{
    task.find((err, lists)=&gt;{
        res.json(tasks);
    })

});

////// to get the sub-tasks from a task with specified id

router.get("/task/:id", (req,res)=&gt;{
    task.findOne({_id:req.params.id},'sub_tasks',(err, sub_tasks)=&gt;{
        res.json(sub_tasks);
    })

});
</code></pre>

<p>I believe the problem is on: <code>$scope.subTasks = response.data.subTasks;</code> since subTasks is the array from which the sub-tasks derive or where all the sub-tasks are pushed when we get them from the database but I'm finding it impossible to find a solution right now. Thanks.</p>

