Mongoose not saving data on update() to Mlab<p>I am trying to add to an existing array inside my User object inside MLAB.</p>

<p>I am using Mongoose 5.1.1 and MongoDB 3.4.9 and I feel like Ive tried every single variation of update(), findByIdAndUpdate(), findAndModify() etc.</p>

<p>I am not sure why this update() method is not working. When I run this code, I get {"ok":0,"n":0,"nModified":0} in my raw response but no errors are being thrown. Ive read the docs and I believe I am running this correctly but clearly not. </p>

<p>Any thoughts? Thank you in advance.</p>

<p>The User onbject in MLAB looks like: </p>

<pre><code>{
    "_id": {
    "$oid": "Blah12345"
},
    "fbid": "123456789101112",
    "email": "myemail@gmail.com",
    "name": "My Name",
    "__v": 0,
    "guestlist": [],
    "reviews": []
}
</code></pre>

<p>My Model</p>

<pre><code>import mongoose from 'mongoose';
import express from 'express';
const router = express.Router();
module.exports = router;
const schemaOptions = {
    collection: "users"
};

const Guestlist = new mongoose.Schema({

    guestlist: [{
        date: String,
        name: String,
        guys: Number,
        girls: Number
    }]


}, schemaOptions);

module.exports = mongoose.model('Guestlist', Guestlist);
</code></pre>

<p>My api file</p>

<pre><code>import express from 'express';
import Guestlist from './data/guestlistModel';
const router = express.Router();

router.post('/guestlist', (req, res) =&gt; {

    const guestlist = new Guestlist();

    let date = req.body.date;
    let name = req.body.name;
    let guys = req.body.guys;
    let girls = req.body.girls;

    const query = {fbid: req.body.fbid};
