        guestlist: {
            date: date,
            name: name,
            guys: guys,
            girls: girls
        }
    }};


    guestlist.update(query, update, (err, raw) =&gt; {


        if (err) throw err;
        if (raw) {
            console.log(JSON.stringify(raw));
            console.log("1 document updated");
            res.sendStatus(200);
        }
    });
});
</code></pre>

